import styled from "styled-components";
import { Tooltip } from "antd";
export const NavlinkWrapper = styled.div`
	margin: auto !important;
	color: #c7c7c7;
`;
export const NavLinkMobile = styled.div`
	@media screen and (max-width: ${props => props.theme.phone}) {
		display: none !important;
	}
	@media screen and (max-width: ${props => props.theme.tablet}) {
		display: flex;
		flex-direction: row !important;
		justify-content: center;
		div {
			margin: 0 5px !important;
		}
	}
	@media screen and (min-width: ${props => props.theme.tablet}) {
		display: none;
	}
`;
export const NavLinkDesktop = styled.div`
	@media screen and (max-width: ${props => props.theme.tablet}) {
		display: none;
	}
	@media screen and (min-width: ${props => props.theme.tablet}) {
		display: flex;
		flex-direction: column;
		justify-content: center;
		text-align: center;
		div {
			margin: 10px 0;
		}
	}
`;
export const NavItemWrapper = styled.div`
	cursor: pointer;
	&:hover {
		color: white;
	}
	i {
		font-size: 1.5em;
	}
`;

export const Nav = ({ title, children }) => (
	<Tooltip title={title}>{/* <Nav>{children}</Nav> */}</Tooltip>
);
